import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

index:{
    alignItems:'center',
    backgroundColor:'red',
    justifyContent:'center',
    height:800,
    
},

indexImg:{
    height:250,
    resizeMode:'cover',
    width:200,
},

});
